import React from "react";

const Socials = () =>{
    return(
        <div className="Socials">
            <div className="Social">
                <div className="LogoSocial"><img src ="./images/Octicons-mark-github.svg" alt="github logo"/>"</div>
                <div className="NameSocial">Github</div>
            </div>
            <div className="Social">
                <div className="LogoSocial"><img src ="./images/linkedin-icon.svg" alt="linkedin logo"/>"</div>
                <div className="NameSocial">Linked In</div>
            </div>
        </div>
    )
}

export default Socials
